function getFactors(e,t,n){if(e==null||e==undefined||typeof e!="number"||e==0||t==null||t==undefined||t.length<=1)return null;var r=new Date,i=0,s=[],n=n==null||n==undefined?!1:n;t=t.filter(function(e){if(typeof e=="number"&&e!=0)return!0});if(t.length<=1)return null;t.sort(function(e,t){return e-t});for(var o=0;o<t.length;o++){var u=o,a=[];function f(n,r){while(r<t.length&&n*t[r-1]<Math.abs(e)){i++;a.push(t[r]);f(n*t[r],r+1);r++;a.pop()}n==e&&a.length>1&&s.push(a.toString())}a.push(t[o]);f(t[o],o+1)}return{target:e,array:t,combinations:s,time:new Date-r,iterations:i+1,verbose:n}};
